	(13, 1, 0, 'Registration successfully', 'Registration successfully!\r\n\r\nDear {employee name},\r\n\r\nYou have registered your account successfully. Please login in iofficez by account\r\n\r\naccount: {account}\r\npassword: {password}\r\n\r\nIf you have any questions about your account or any other mater, please feel free to contact at support@iofficez.com', 'success_employee_registration', 'admin@centeroffice.vn', NULL, 'en', 0, 0, 0, 0, b'0'),
	(14, 1, 0, 'Đăng ký thành viên thành công', 'Đăng ký thành công!\r\n\r\n{employee name} thân mến, \r\n\r\nBạn đã đăng ký tài khoản của bạn thành công. Đây là thông tin đăng nhập tài khoản iofficez của bạn:\r\n\r\nEmail: {account}\r\nMật khẩu: {password}\r\n\r\nNếu có bất kỳ câu hỏi về tài khoản của bạn or bất kỳ điều gì, xin hãy liên hệ với chúng tôi qua địa chỉ support@iofficez.com\r\n', 'success_employee_registration', 'admin@centeroffice.vn', NULL, 'vi', 0, 0, 0, 0, b'0'),
	(15, 1, 0, 'Yêu cầu lấy lại mật khẩu', 'YÊU CẦU LẤY LẠI MẬT KHẨU\r\n\r\nChào {employee name},\r\n\r\nBạn vừa thực hiện yêu cầu lấy lại mật khẩu trên {service}. Để hoàn tất việc lấy lại mật khẩu, vui lòng nhấn vào đường dẫn dưới đây hoặc chép và dán vào trình duyệt:\r\n{link}\r\nNếu không phải bạn thực hiện, vui lòng KHÔNG nhấn vào đường dẫn trên.\r\n\r\nMọi thắc mắc xin vui lòng liên hệ website: {support email}.\r\n\r\n{service} Team', 'request_password_again', 'admin@centeroffice.vn', NULL, 'vi', 0, 0, 0, 0, b'0'),
	(16, 1, 0, 'Request password sent', 'REQUEST PASSWORD SENT !\r\n\r\nHi {employee name},\r\n\r\nYou have just requested your password from {service}. To complete getting your password, please click on the link below or copy it and paste in address bar of browser.\r\n{link}\r\nIf you don\'t, please don\'t click on the link above.\r\n\r\nIf you have any question, please contact us: {support email}.\r\n\r\n{service} Team', 'request_password_again', 'admin@centeroffice.vn', NULL, 'en', 0, 0, 0, 0, b'0');
