	(234, 1, 2, 18, 'ành tặng những lời khen ngợi', '<ul class="how" style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 16px; line-height: 25px; font-family: Roboto, Arial, serif; vertical-align: baseline; list-style: none; color: #555555;">\n<li class="jsArticleStep" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">\n<div class="stepContent" style="box-sizing: border-box; margin: 0px 0px 0px 45px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;"><span style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: inherit;">Tập trung nh&igrave;n v&agrave;o đ&ocirc;i mắt n&agrave;ng</span></p>\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Khi n&oacute;i chuyện với n&agrave;ng bạn n&ecirc;n nh&igrave;n thẳng v&agrave;o mắt của c&ocirc; ấy. H&atilde;y thể hiện sự ch&uacute; &yacute; v&agrave; quan t&acirc;m của m&igrave;nh v&agrave;o c&ocirc; ấy. Bạn đừng n&ecirc;n nh&igrave;n v&agrave;o những vị tr&iacute; kh&aacute;c tr&ecirc;n người của n&agrave;ng tr&ocirc;ng bạn sẽ v&ocirc; c&ugrave;ng tẻ nhạt v&agrave; biến m&igrave;nh th&agrave;nh một kẻ th&ocirc; lỗ.</p>\n</div>\n</li>\n</ul>\n<ul class="how" style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 16px; line-height: 25px; font-family: Roboto, Arial, serif; vertical-align: baseline; list-style: none; color: #555555;">\n<li class="jsArticleStep" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">\n<div class="stepNumber" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline; float: left; width: 30px; height: 30px; text-align: center; color: #ffffff; background: url(\'Themes/Portal/Default/Images/bg-step.png\') 50% 50% no-repeat;">4</div>\n<div class="stepContent" style="box-sizing: border-box; margin: 0px 0px 0px 45px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;"><span style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: inherit;">Cư xử lịch l&atilde;m</span></p>\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Con g&aacute;i đều mong muốn một người đ&agrave;n &ocirc;ng cư xử thật lịch l&atilde;m. Lu&ocirc;n chủ động l&agrave; người mở cửa (ở bất k&igrave; nơi n&agrave;o: nh&agrave; h&agrave;ng, qu&aacute;n c&agrave; ph&ecirc;&hellip; trong c&aacute;c buổi hẹn h&ograve;), k&eacute;o ghế v&agrave; chờ cho c&ocirc; ấy ngồi xuống. Để cho c&ocirc; ấy thấy bản th&acirc;n m&igrave;nh được t&ocirc;n trọng v&agrave; ngay lập tức bạn sẽ&nbsp;ghi được&nbsp;điểm trước mắt của n&agrave;ng.</p>\n</div>\n</li>\n</ul>', '\n\n\nTập trung nh&igrave;n v&agrave;o đ&ocirc;i mắt n&agrave;ng\nKhi n&oacute;i chuyện với n&agrave;ng bạn n&ecirc;n nh&igrave;n thẳng v&agrave;o mắt của c&ocirc; ấy. H&atilde;y thể hiện sự ch&uacute; &yacute; v&agrave; quan t&acirc;m của m&igrave;nh v&agrave;o c&ocirc; ấy. Bạn đừng n&ecirc;n nh&igrave;n v&agrave;o những vị tr&iacute; kh&aacute;c tr&ecirc;n người của n&agrave;ng tr&ocirc;ng bạn sẽ v&ocirc; c&ugrave;ng tẻ nhạt v&agrave; biến m&igrave;nh th&agrave;nh một kẻ th&ocirc; lỗ.\n\n\n\n\n\n4\n\nCư xử lịch l&atilde;m\nCon g&aacute;i đều mong muốn một người đ&agrave;n &ocirc;ng cư xử thật lịch l&atilde;m. Lu&ocirc;n chủ động l&agrave; người mở cửa (ở bất k&igrave; nơi n&agrave;o: nh&agrave; h&agrave;ng, qu&aacute;n c&agrave; ph&ecirc;&hellip; trong c&aacute;c buổi hẹn h&ograve;), k&eacute;o ghế v&agrave; chờ cho c&ocirc; ấy ngồi xuống. Để cho c&ocirc; ấy thấy bản th&acirc;n m&igrave;nh được t&ocirc;n trọng v&agrave; ngay lập tức bạn sẽ&nbsp;ghi được&nbsp;điểm trước mắt của n&agrave;ng.\n\n\n', 'y nói để cô ấy hiểu có như vậy nàng mới tin tưởng bạn và giao trọn trái tim của mình cho bạn.', 1473199200, 1473285600, b'1', '51b749', b'0', 1473078576, 1473078576, 18, 18, b'1'),
	(235, 1, 3, 18, 'Thương hiệu3', '<p><span style="font-family: arial; font-size: 12px; background-color: #f5f5f5;">I được th&agrave;nh lập tại S&agrave;i G&ograve;n v&agrave;o năm 1875 bởi một sĩ quan h&agrave;ng hải đ&atilde; giải ngũ t&ecirc;n Victor Larue, BGI l&agrave; viết tắt của Brasseries Glaci&egrave;res d&rsquo;Indochine (H&atilde;ng bia v&agrave; nước đ&aacute; Đ&ocirc;ng Dương). Nổi tiếng v&agrave; l&acirc;u đời nhất l&agrave; Nh&agrave; m&aacute;y bia Chợ Lớn v&agrave; Usine Belgique, được x&acirc;y dựng từ năm 1952. Đến năm 1954, khi Đ&ocirc;ng Dương kh&ocirc;ng c&ograve;n nữa th&igrave; h&atilde;ng đổi t&ecirc;n th&agrave;nh Brasseries Glaci&egrave;res Internationales, vẫn viết tắt l&agrave; BGI.</span><span style="font-family: arial; font-size: 12px; background-color: #f5f5f5;">I được th&agrave;nh lập tại S&agrave;i G&ograve;n v&agrave;o năm 1875 bởi một sĩ quan h&agrave;ng hải đ&atilde; giải ngũ t&ecirc;n Victor Larue, BGI l&agrave; viết tắt của Brasseries Glaci&egrave;res d&rsquo;Indochine (H&atilde;ng bia v&agrave; nước đ&aacute; Đ&ocirc;ng Dương). Nổi tiếng v&agrave; l&acirc;u đời nhất l&agrave; Nh&agrave; m&aacute;y bia Chợ Lớn v&agrave; Usine Belgique, được x&acirc;y dựng từ năm 1952. Đến năm 1954, khi Đ&ocirc;ng Dương kh&ocirc;ng c&ograve;n nữa th&igrave; h&atilde;ng đổi t&ecirc;n th&agrave;nh Brasseries Glaci&egrave;res Internationales, vẫn viết tắt l&agrave; BGI.</span><span style="font-family: arial; font-size: 12px; background-color: #f5f5f5;">I được th&agrave;nh lập tại S&agrave;i G&ograve;n v&agrave;o năm 1875 bởi một sĩ quan h&agrave;ng hải đ&atilde; giải ngũ t&ecirc;n Victor Larue, BGI l&agrave; viết tắt của Brasseries Glaci&egrave;res d&rsquo;Indochine (H&atilde;ng bia v&agrave; nước đ&aacute; Đ&ocirc;ng Dương). Nổi tiếng v&agrave; l&acirc;u đời nhất l&agrave; Nh&agrave; m&aacute;y bia Chợ Lớn v&agrave; Usine Belgique, được x&acirc;y dựng từ năm 1952. Đến năm 1954, khi Đ&ocirc;ng Dương kh&ocirc;ng c&ograve;n nữa th&igrave; h&atilde;ng