	(282, 1, 1, 2, 'new calendar', '<div class="title_news" style="margin: 10px 0px 0px; padding: 0px 0px 10px; width: 480.016px; float: left; color: #333333; font-family: arial; font-size: 12px;">\n<h1 style="margin: 0px; padding: 0px; font-weight: 400; font-stretch: normal; font-size: 28px; line-height: 32px; text-rendering: geometricPrecision;">C&aacute;ch l&agrave;m nhụt ch&iacute; \'quan tham\' của vua Minh Mạng</h1>\n</div>\n<h3 class="short_intro txt_666" style="margin: 0px; padding: 0px 0px 10px; color: #444444; font-stretch: normal; font-size: 14px; line-height: 18px; font-family: arial; width: 480.016px; float: left; text-rendering: geometricPrecision;">D&ugrave; Bộ h&igrave;nh xử &aacute;n phạt đi đ&agrave;y với vị quan biển thủ hơn một lạng v&agrave;ng, nhưng vua Minh Mạng ra lệnh ch&eacute;m b&ecirc;u đầu ở chợ Đ&ocirc;ng Ba cho người kh&aacute;c thấy thế m&agrave; tự răn m&igrave;nh.</h3>\n<div id="left_calculator" style="margin: 0px; padding: 0px; font-family: arial; font-size: 12px;">\n<div class="fck_detail width_common block_ads_connect" style="margin: 0px; padding: 0px 9.59375px 0px 0px; width: 470.406px; float: left; overflow: hidden; font-stretch: normal; font-size: 14px; color: #333333;">\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision;">L&ecirc;n ng&ocirc;i năm 1820, vua Minh Mạng (1791-1841) tiến h&agrave;nh h&agrave;ng loạt<span style="margin: 0px; padding: 0px;">&nbsp;cải c&aacute;ch h&agrave;nh ch&iacute;nh; thắt chặt c&aacute;c quy định ph&aacute;p luật, xem nạn quan tham &ocirc;, tham nhũng l&agrave; ẩn họa l&agrave;m suy yếu đất nước.</span></p>\n</div>\n</div>', '', '', 1478797200, 1478883600, b'0', '3b91ad', b'0', 1479603660, 1479603660, 2, 2, b'0'),
	(283, 1, 1, 2, 'seeeeeeeetttt', '<div class="title_news" style="margin: 10px 0px 0px; padding: 0px 0px 10px; width: 480.016px; float: left; color: #333333; font-family: arial; font-size: 12px;">\n<h3 class="short_intro txt_666" style="margin: 0px; padding: 0px 0px 10px; color: #444444; font-stretch: normal; font-size: 14px; line-height: 18px; width: 480.016px; float: left; text-rendering: geometricPrecision;">Hiệu ứng Trump xuất hiện trong mọi cuộc thảo luận ở Lima, Peru, nơi l&atilde;nh đạo 21 nước với hơn một nửa t&agrave;i sản to&agrave;n cầu đang tụ họp.&nbsp;</h3>\n<div class="relative_new" style="margin: 0px; padding: 0px 0px 5px; width: 480.016px; float: left; color: #000000; font-size: 12px; line-height: normal;">\n<ul class="list_news_dot_3x3_300" style="margin: 0px; padding: 0px; list-style-type: none; width: 480.016px; float: left; border: none; color: #666666;">\n<li style="margin: 0px; padding: 0px 0px 5px 10px; list-style-type: none; background: url(\'images/graphics/bg_dot_gray_3x3.gif\') 0px 6px no-repeat;"><a style="margin: 0px; padding: 0px; color: #666666; text-decoration: none; outline: 1px; font-weight: bold; font-stretch: normal; line-height: 16px;" tabindex="1" href="http://vnexpress.net/tin-tuc/the-gioi/chu-tich-nuoc-tran-dai-quang-toi-peru-du-hoi-nghi-apec-3501231.html?utm_source=detail&amp;utm_medium=box_relatedtop&amp;utm_campaign=boxtracking">Chủ tịch nước Trần Đại Quang tới Peru dự hội nghị APEC</a>&nbsp; / &nbsp;<a style="margin: 0px; padding: 0px; color: #666666; text-decoration: none; outline: 1px; font-weight: bold; font-stretch: normal; line-height: 16px;" tabindex="2" href="http://vnexpress.net/tin-tuc/the-gioi/nga-yeu-cau-thuy-si-giai-thich-viec-tiem-kich-theo-sat-chuyen-co-di-du-apec-3501533.html?utm_source=detail&amp;utm_medium=box_relatedtop&amp;utm_campaign=boxtracking">Nga y&ecirc;u cầu Thụy Sĩ giải th&iacute;ch việc ti&ecirc;m k&iacute;ch theo s&aacute;t chuy&ecirc;n cơ đi dự APEC</a></li>\n</ul>\n</div>\n<div id="left_calculator" style="margin: 0px; padding: 0px; color: #000000; font-size: 12px; line-height: normal;">\n<div class="fck_detail width_common block_ads_connect" style="margin: 0px; padding: 0px 9.59375px 0px 0px; width: 470.406px; float: left; overflow: hidden; font-stretch: normal; font-size: 14px; color: #333333;">\n<table class="tplCaption" style="margin: 0px auto 10px; padding: 0px; max-width: 100%; width: 470px;" border="0" cellspacing="0" cellpadding="3" align="center">\n<tbody style="margin: 0px; padding: 0px;">\n<tr style="margin: 0px; padding: 0px;">\n<td style="margin: 0px; padding: 0px; line-height: 0;"><img style="margin: 0px; padding: 0px; border: 0px; font-size: 0px; line-height: 0; max-width: 100%; width: 470px;" src="http://img.f29.vnecdn.net/2016/11/20/xi-jinping-4515-1479600992.jpg" alt="Chủ tịch Trung Quốc Tập Cận B&igrave;nh ph&aacute;t biểu tại hội nghị. Ảnh: Reuters" data-natural-width="500" data-width="500" data-pwidth="470.40625" /></td>\n</tr>\n<tr style="margin: 0px; padding: 0px;">\n<td style="margin: 0px; padding: 0px; line-height: 0;">\n<p class="Image" style="margin: 0px; padding: 10px; line-height: normal; text-rendering: geometricPrecision; font-stretch: normal; font-size: 12px; font-family: arial; background: #f5f5f5;">Chủ tịch Trung Quốc Tập Cận B&igrave;nh ph&aacute;t biểu tại hội nghị. Ảnh:&nbsp;<em style="margin: 0px; padding: 0px;">Reuters</em></p>\n</td>\n</tr>\n</tbody>\n</table>\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision;"><span style="margin: 0px; padding: 0px;">"Sự phục hồi kinh tế to&agrave;n cầu vẫn yếu ớt khi đ&agrave; ph&aacute;t triển kh&ocirc;ng đủ mạnh", &ocirc;</span><span style="margin: 0px; padding: 0px;">ng Tập h&ocirc;m 19/11 n&oacute;i trong b&agrave;i ph&aacute;t biểu ch&iacute;nh tại Hội nghị L&atilde;nh đạo kinh tế APEC ở Lima, Peru. "Đối mặt với th&aacute;ch thức của sự rủi ro, tất cả c&aacute;c b&ecirc;n cần hợp t&aacute;c v&agrave; giữ tinh thần hợp t&aacute;c, đ&ocirc;i b&ecirc;n c&ugrave;ng c&oacute; lợi".</span></p>\n</div>\n</div>\n</div>', 'Hiệu ứng Trump xuất hiện trong mọi cuộc thảo luận ở Lima, Peru, nơi lãnh đạo 21 nước với hơn một nửa tài sản toàn cầu đang tụ họp. \nChủ tịch nước Trần Đại Quang tới Peru dự hội nghị APEC  /  Nga yêu cầu Thụy Sĩ giải thích việc tiêm kích theo sát chuyên cơ đi dự APEC\n\nChủ tịch Trung Quốc Tập Cận Bình phát biểu tại hội nghị. Ảnh: Reuters\n"Sự phục hồi kinh tế toàn cầu vẫn yếu ớt khi đà phát triển không đủ mạnh", ông Tập hôm 19/11 nói trong bài phát biểu chính tại Hội nghị Lãnh đạo kinh tế APEC ở Lima, Peru. "Đối mặt với thách thức của sự rủi ro, tất cả các bên cần hợp tác và giữ tinh thần hợp tác, đôi bên cùng có lợi".', '', 1478365200, 1478451600, b'0', '3b91ad', b'0', 1479603880, 1479604570, 2, 2, b'0'),
