	(26, 1, 231, 18, 0, 0, '<p><span style="color: #4b4f56; font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 18.76px;">&ldquo;Trong Khởi Nghiệp, bạn sẽ kh&ocirc;ng bao giờ Th&agrave;nh C&ocirc;ng nếu chưa từng một lần Thất Bại. Nếu thất bại một lần h&atilde;y thất bại một c&aacute;ch thật th&ocirc;ng minh.&rdquo; Anh Nguyễn Hữu Th&aacute;i H&ograve;a - Ph&oacute; Chủ tịch Hội đồng Tư vấn chiến lược ki&ecirc;m Gi&aacute;m đốc Tư vấn chiến lược Tập đo&agrave;n VNPT đồng thời cũng l&agrave; diễn giả của sự kiện FAIL SMART.</span></p>', '&ldquo;Trong Khởi Nghiệp, bạn sẽ kh&ocirc;ng bao giờ Th&agrave;nh C&ocirc;ng nếu chưa từng một lần Thất Bại. Nếu thất bại một lần h&atilde;y thất bại một c&aacute;ch thật th&ocirc;ng minh.&rdquo; Anh Nguyễn Hữu Th&aacute;i H&ograve;a - Ph&oacute; Chủ tịch Hội đồng Tư vấn chiến lược ki&ecirc;m Gi&aacute;m đốc Tư vấn chiến lược Tập đo&agrave;n VNPT đồng thời cũng l&agrave; diễn giả của sự kiện FAIL SMART.', b'0', 0, 0, 0, 0, b'0'),
