	(28, 1, 231, 18, 0, 0, '<p><span style="color: #4b4f56; font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 18.76px;">Nhưng bạn c&oacute; biết b&ecirc;n cạnh những th&agrave;nh c&ocirc;ng h&agrave;o nho&aacute;ng kia th&igrave; thất bại dường như c</span><span class="text_exposed_show" style="display: inline; font-family: helvetica, arial, sans-serif; color: #4b4f56; font-size: 14px; line-height: 18.76px;">ũng chẳng xa lạ trong giới khởi nghiệp bởi gần 99.993333% dự &aacute;n khởi nghiệp đều thất bại ngay năm đầu ti&ecirc;n. Để c&oacute; thể khởi nghiệp th&agrave;nh c&ocirc;ng bạn chắc chắn &iacute;t nhất v&agrave;i lần nếm m&ugrave;i thất bại v&agrave; cần chuẩn bị cho m&igrave;nh một tinh thần th&eacute;p để c&oacute; thể đối mặt với thất bại một c&aacute;ch th&ocirc;ng minh nhất.</span></p>', '<p><span style="color: #4b4f56; font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 18.76px;">Nhưng bạn c&oacute; biết b&ecirc;n cạnh những th&agrave;nh c&ocirc;ng h&agrave;o nho&aacute;ng kia th&igrave; thất bại dường như c</span><span class="text_exposed_show" style="display: inline; font-family: helvetica, arial, sans-serif; color: #4b4f56; font-size: 14px; line-height: 18.76px;">ũng chẳng xa lạ trong giới khởi nghiệp bởi gần 99.993333% dự &aacute;n khởi nghiệp đều thất bại ngay năm đầu ti&ecirc;n. Để c&oacute; thể khởi nghiệp th&agrave;nh c&ocirc;ng bạn chắc chắn &iacute;t nhất v&agrave;i lần nếm m&ugrave;i thất bại v&agrave; cần chuẩn bị cho m&igrave;nh một tinh thần th&eacute;p để c&oacute; thể đối mặt với thất bại một c&aacute;ch th&ocirc;ng minh nhất.</span></p>', b'0', 0, 0, 0, 0, b'0'),
