	(51, 1, 235, 18, 0, 0, '<p><span style="font-family: arial; font-size: 12px; background-color: #f5f5f5;">I được th&agrave;nh lập tại S&agrave;i G&ograve;n v&agrave;o năm 1875 bởi một sĩ quan h&agrave;ng hải đ&atilde; giải ngũ t&ecirc;n Victor Larue, BGI l&agrave; viết tắt của Brasseries Glaci&egrave;res d&rsquo;Indochine (H&atilde;ng bia v&agrave; nước đ&aacute; Đ&ocirc;ng Dương). Nổi tiếng v&agrave; l&acirc;u đời nhất l&agrave; Nh&agrave; m&aacute;y bia Chợ Lớn v&agrave; Usine Belgique, được x&acirc;y dựng từ năm 1952. Đến năm 1954, khi Đ&ocirc;ng Dương kh&ocirc;ng c&ograve;n nữa th&igrave; h&atilde;ng đổi t&ecirc;n th&agrave;nh Brasseries Glaci&egrave;res Internationales, vẫn viết tắt l&agrave; BGI.&nbsp;</span></p>\n<p><span style="font-family: arial; font-size: 12px; background-color: #f5f5f5;">33333</span></p>', '<p><span style="font-family: arial; font-size: 12px; background-color: #f5f5f5;">I được th&agrave;nh lập tại S&agrave;i G&ograve;n v&agrave;o năm 1875 bởi một sĩ quan h&agrave;ng hải đ&atilde; giải ngũ t&ecirc;n Victor Larue, BGI l&agrave; viết tắt của Brasseries Glaci&egrave;res d&rsquo;Indochine (H&atilde;ng bia v&agrave; nước đ&aacute; Đ&ocirc;ng Dương). Nổi tiếng v&agrave; l&acirc;u đời nhất l&agrave; Nh&agrave; m&aacute;y bia Chợ Lớn v&agrave; Usine Belgique, được x&acirc;y dựng từ năm 1952. Đến năm 1954, khi Đ&ocirc;ng Dương kh&ocirc;ng c&ograve;n nữa th&igrave; h&atilde;ng đổi t&ecirc;n th&agrave;nh Brasseries Glaci&egrave;res Internationales, vẫn viết tắt l&agrave; BGI.&nbsp;</span></p>\n<p><span style="font-family: arial; font-size: 12px; background-color: #f5f5f5;">33333</span></p>', b'0', 1473132581, 1473512692, 18, 18, b'0'),
