	(191, 1, 2, 2, 1, 0, 'test new tinymce optiontest new tinymce optiontest new tinymce option', '<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision; color: #333333; font-family: arial; font-size: 14px;">kong Enterprise Fund II l&agrave; quỹ thuộc Mekong Capital đầu tư mạnh v&agrave;o c&aacute;c doanh nghiệp b&aacute;n lẻ tại Việt Nam. Từ rất sớm, quỹ n&agrave;y nắm 30% cổ phần tại Thế giới Di động. Tuy nhi&ecirc;n, trước thời điểm doanh nghiệp l&ecirc;n s&agrave;n, quỹ đ&atilde; tho&aacute;i bớt một phần vốn để chốt lời.</p>\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision; color: #333333; font-family: arial; font-size: 14px;">T&iacute;nh đến đầu th&aacute;ng 7 vừa qua, quỹ ngoại n&agrave;y c&ograve;n nắm 16,04 triệu cổ phần - tương ứng 10,1% vốn của Thế giới Di động. Khi giao dịch sắp tới ho&agrave;n th&agrave;nh, Mekong Enterprise sẽ giảm sở hữu đ&aacute;ng kể xuống c&ograve;n 7,39% - tương ứng 10,8 triệu cổ phần.</p>\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision; color: #333333; font-family: arial; font-size: 14px;">Một trường hợp kh&aacute;c l&agrave; Quỹ Ntasian Discovery Master Fund cũng b&aacute;n ra 1 triệu cổ phiếu MWG hồi đầu th&aacute;ng 7, khi m&atilde; n&agrave;y đang ở đỉnh gi&aacute;, qua đ&oacute; giảm sở hữu xuống 4,76%. Sau giao dịch, Ntasian kh&ocirc;ng c&ograve;n l&agrave; cổ đ&ocirc;ng lớn n&ecirc;n việc tho&aacute;i hết vốn khỏi Thế giới Di động ho&agrave;n to&agrave;n kh&ocirc;ng phải b&aacute;o c&aacute;o c&ocirc;ng khai.</p>\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision; color: #333333; font-family: arial; font-size: 14px;">C&ugrave;ng với những giao dịch tr&ecirc;n, em g&aacute;i &ocirc;ng&nbsp;</p>', '<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px;