	(231, 1, 14, 9, 1, 0, 'fix parse content again', '<p>$project$project$project&nbsp;</p>\n<header class="the-article-header" style="box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; float: left; width: 660px; font-family: Arial, sans-serif; line-height: 13.7143px; background: transparent;">\n<h1 class="the-article-title cms-title" style="box-sizing: border-box; text-rendering: geometricPrecision; margin: 10px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 2rem; vertical-align: baseline; font-family: \'Noto Serif\', serif; color: #111111; line-height: 1.2; -webkit-font-smoothing: antialiased; letter-spacing: -1px !important; background: transparent;">Trump thắng nhờ th&ocirc;ng tin giả mạo tr&ecirc;n Facebook như thế n&agrave;o</h1>\n<ul class="the-article-meta" style="box-sizing: border-box; text-rendering: geometricPrecision; margin: 5px 0px 0px; padding: 0px 0px 0px 3px; border: 0px; outline: 0px; vertical-align: baseline; list-style: none; float: left; width: 660px; font-family: Helvetica, Arial, sans-serif; color: #999999; line-height: 18px; -webkit-font-smoothing: antialiased; background: transparent;">\n<li class="the-article-publish cms-date" style="box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 10px 10px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; float: left; display: block; background: transparent;">08:35 18/11/2016</li>\n</ul>\n</header>\n<ul class="the-article-tools" style="box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; list-style: none; width: 43px; position: absolute; left: 0px; z-index: 999; font-family: Arial, sans-serif; line-height: 13.7143px; top: 209px; background: #f7f7f7;">\n<li class="btnFacebook" style="box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; width: 43px; height: 43px; display: block; cursor: pointer; line-height: 46px; text-align: center; -webkit-font-smoothing: antialiased; position: relative; background: #1f73d2;"></li>\n<li class="btnEmail" style="box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; width: 43px; height: 43px; display: block; cursor: pointer; line-height: 46px; text-align: center; -webkit-font-smoothing: antialiased; position: relative; background: #00aee8;"></li>\n<li class="btnError highlighted" style="box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; width: 43px; height: 43px; display: block; cursor: pointer; line-height: 46px; text-align: center; -webkit-font-smoothing: antialiased; position: relative; background: #555555;"></li>\n<li class="btnComment" style="box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; width: 43px; height: 43px; display: block; cursor: pointer; line-height: 46px; text-align: center; -webkit-font-smoothing: antialiased; position: relative; background: #00c191;"><span class="counter" style="box-sizing: border-box; text-rendering: geometricPrecision; margin: 1px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; display: block; width: 43px; height: 24px; font-weight: bold; color: #ffffff; line-height: 24px; -webkit-font-smoothing: antialiased; background: #1eaf8b;">1</span></li>\n</ul>\n<p class="the-article-summary cms-desc" style="box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 14px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; font-family: \'Noto Serif\', serif; font-weight: bold; color: #222222; line-height: 26px; -webkit-font-smoothing: antialiased; clear: both; float: left; width: 660px; background: transparent;">&nbsp;Việc những người ủng hộ Trump đọc th&ocirc;ng tin tr&ecirc;n Facebook m&agrave; kh&ocirc;ng x&aacute;c minh nội dung l&agrave; giả mạo hay ch&iacute;nh x&aacute;c g&oacute;p c&ocirc;ng lớn trong chiến thắng của nh&agrave; tỷ ph&uacute; bất động sản.</p>\n<div class="the-article-body cms-body" style="box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; float: left; width: 660px; position: relative; font-family: \'Noto Serif\', serif; color: #222222; line-height: 26px; -webkit-font-smoothing: antialiased; background: transparent;">\n<p style="box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 18px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; float: none; width: 660px; background: transparent;">Khi ph&acirc;n t&iacute;ch c&aacute;c b&agrave;i viết về bầu cử trong 3 th&aacute;ng cuối c&ugrave;ng,<em style="box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;">&nbsp;BuzzFeed</em>&nbsp;kết luận c&aacute;c trang tin giả tạo ra nhiều tương t&aacute;c tr&ecirc;n Facebook hơn cả từ 19 h&atilde;ng tin lớn gộp lại. Trong số 20 bản tin giả chia sẻ nhiều tr&ecirc;n Facebook, phần lớn l&agrave; c&aacute;c nội dung giả mạo nhằm ủng hộ Trump.</p>\n<p style="box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;">20 tin b&agrave;i giả mạo c&oacute; lượng tương t&aacute;c cao nhất trong ba th&aacute;ng cuối c&oacute; 8.710.000 shares, tương t&aacute;c v&agrave; b&igrave;nh luận tr&ecirc;n Facebook - một con số rất lớn. Một số tin giả như Gi&aacute;o ho&agrave;ng Francis ủng hộ Trump c&oacute; tới gần 1 triệu tương t&aacute;c.&nbsp;</p>\n<p style="box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;">Paul Horner, 38 tuổi, l&agrave; người chuy&ecirc;n tạo ra những bản tin giả tr&ecirc;n mạng v&agrave; đẩy n&oacute; lan truyền tr&ecirc;n Facebook với tốc độ ch&oacute;ng mặt. Một số bản tin của anh, đặc biệt khi li&ecirc;n quan đến Donald Trump, ng&agrave;y c&agrave;ng c&oacute; ảnh hưởng, tiếp cận được đ&ocirc;ng đảo người d&ugrave;ng Internet hơn.</p>\n</div>', '$project$project$project \n\nTrump thắng nhờ thông tin giả mạo trên Facebook như thế nào\n08:35 18/11/2016\n1\n Việc những người ủng hộ Trump đọc thông tin trên Facebook mà không xác minh nội dung là giả mạo hay chính xác góp công lớn trong chiến thắng của nhà tỷ phú bất động sản.\nKhi phân tích các bài viết về bầu cử trong 3 tháng cuối cùng, BuzzFeed kết luận các trang tin giả tạo ra nhiều tương tác trên Facebook hơn cả từ 19 hãng tin lớn gộp lại. Trong số 20 bản tin giả chia sẻ nhiều trên Facebook, phần lớn là các nội dung giả mạo nhằm ủng hộ Trump.\n\n20 tin bài giả mạo có lượng tương tác cao nhất trong ba tháng cuối có 8.710.000 shares, tương tác và bình luận trên Facebook - một con số rất lớn. Một số tin giả như Giáo hoàng Francis ủng hộ Trump có tới gần 1 triệu tương tác. \n\nPaul Horner, 38 tuổi, là người chuyên tạo ra những bản tin giả trên mạng và đẩy nó lan truyền trên Facebook với tốc độ chóng mặt. Một số bản tin của anh, đặc biệt khi liên quan đến Donald Trump, ngày càng có ảnh hưởng, tiếp cận được đông đảo người dùng Internet hơn.', NULL, NULL, 56, 0, 0, b'0', 1479445194, 1479445194, 2, 2, b'1'),
	(232, 1, 2, 1, 1, 0, 's f dsff', '<h3 style="box-sizing: border-box; margin: 20px 0px 10px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 18px; line-height: 1.1; font-family: Roboto, Arial, serif; vertical-align: baseline; color: #555555;"><span style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 12pt; line-height: inherit; font-family: inherit; vertical-align: baseline;">Vậy l&agrave;m sao để biết con g&aacute;i th&iacute;ch m&igrave;nh hay kh&ocirc;ng?</span></h3>\n<ul class="how" style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 16px; line-height: 25px; font-family: Roboto, Arial, serif; vertical-align: baseline; list-style: none; color: #555555;">\n<li class="jsArticleStep" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">\n<div class="stepNumber" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline; float: left; width: 30px; height: 30px; text-align: center; color: #ffffff; background: url(\'http://media.lamsao.com/Themes/Portal/Default/Images/bg-step.png\') 50% 50% no-repeat;">1</div>\n<div class="stepContent" style="box-sizing: border-box; margin: 0px 0px 0px 45px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-style: inherit; font-va