	(69, 1, 150, 20, 0, 0, 'Vì nguồn thu để lại theo tỷ lệ điều tiết quá hạn hẹp nên theo lãnh đạo thành phố, từ năm 2011 đến 2015, số cân đối từ thuế dành cho chi đầu tư và phát triển của địa phương chỉ khoảng 9.500 tỷ đồng một năm, nhưng phải bố trí hơn 28% để thanh toán cho các khoản nợ và lãi vay đến hạn (2.700 tỷ đồng). Do vậy địa phương chỉ chi khoảng 6.800 tỷ đồng cho đầu tư phát triển, đáp ứng khoảng 19% nhu cầu.', 'Vì nguồn thu để lại theo tỷ lệ điều tiết quá hạn hẹp nên theo lãnh đạo thành phố, từ năm 2011 đến 2015, số cân đối từ thuế dành cho chi đầu tư và phát triển của địa phương chỉ khoảng 9.500 tỷ đồng một năm, nhưng phải bố trí hơn 28% để thanh toán cho các khoản nợ và lãi vay đến hạn (2.700 tỷ đồng). Do vậy địa phương chỉ chi khoảng 6.800 tỷ đồng cho đầu tư phát triển, đáp ứng khoảng 19% nhu cầu.', b'0', 1465363332, 1465363332, 20, 20, b'0'),
	(70, 1, 150, 20, 0, 0, 'Trước thực tế này, bà Thắng kiến nghị Ủy ban Tài chính ngân sách có ý kiến để Chính phủ và Bộ Tài chính xem xét quy định tỷ lệ điều tiết số thu ngân sách cho thành phố đủ 33% và ổn định trong vòng 10 năm từ năm 2017. UBND TP HCM kiến nghị việc áp dụng phân bổ ngân sách Nhà nước cho chi đầu tư phát triển và chi thường xuyên năm 2017, cần áp dụng nguyên tắc ghi nhận các nội dung chi đặc thù của TP HCM, dựa trên tổng số dân trên địa bàn (gồm cả vãng lai và người dân nhập cư không chính thức) đối với các dịch vụ cơ bản...', 'Trước thực tế này, bà Thắng kiến nghị Ủy ban Tài chính ngân sách có ý kiến để Chính phủ và Bộ Tài chính xem xét quy định tỷ lệ điều tiết số thu ngân sách cho thành phố đủ 33% và ổn định trong vòng 10 năm từ năm 2017. UBND TP HCM kiến nghị việc áp dụng phân bổ ngân sách Nhà nước cho chi đầu tư phát triển và chi thường xuyên năm 2017, cần áp dụng nguyên tắc ghi nhận các nội dung chi đặc thù của TP HCM, dựa trên tổng số dân trên địa bàn (gồm cả vãng lai và người dân nhập cư không chính thức) đối với các dịch vụ cơ bản...', b'0', 1465363347, 1465363347, 20, 20, b'0'),
	(71, 1, 150, 20, 0, 0, 'Ông Trần Du Lịch, thành viên Hội đồng Tư vấn chính sách tiền tệ quốc gia, cho rằng thực chất TP HCM "không xin cái đặc thù mà chỉ xin cái bình thường" của một đô thị trên thế giới là tính tự chủ, tự chịu trách nhiệm của địa phương. Vị này cho rằng khi tính toán, không thể so TP HCM với các tỉnh, bởi đây là một đô thị nên phải so với các đô thị phát triển khác trong khu vực.', 'Ông Trần Du Lịch, thành viên Hội đồng Tư vấn chính sách tiền tệ quốc gia, cho rằng thực chất TP HCM "không xin cái đặc thù mà chỉ xin cái bình thường" của một đô thị trên thế giới là tính tự chủ, tự chịu trách nhiệm của địa phương. Vị này cho rằng khi tính toán, không thể so TP HCM với các tỉnh, bởi đây là một đô thị nên phải so với các đô thị phát triển khác trong khu vực.', b'0', 1465363382, 1465363382, 20, 20, b'0'),
	(72, 1, 150, 13, 0, 0, 'Tại buổi làm việc, người đứng đầu Thành ủy TP HCM - Bí thư Đinh La Thăng tiếp tục nêu quan điểm cho rằng điều quan trọng với thành phố là cần có cơ chế, tạo môi trường kinh doanh cho doanh nghiệp tốt nhất, tạo cơ chế để làm ra tiền nhiều hơn. Ông Thăng so sánh các đô thị như Bắc Kinh, Thượng Hải, Thâm Quyến… của Trung Quốc từng được ban hành thể chế, chính sách và chỉ áp dụng cho riêng thành phố. Các biện pháp rà soát phòng chống gian lận thuế sẽ được đẩy mạnh; tiếp tục tháo gỡ khó khăn cho doanh nghiệp và đẩy mạnh phân cấp, phân quyền cho các huyện, quận, sở, ngành. Từ đó, công tác thu ngân sách sẽ tốt hơn...', 'Tại buổi làm việc, người đứng đầu Thành ủy TP HCM - Bí thư Đinh La Thăng tiếp tục nêu quan điểm cho rằng điều quan trọng với thành phố là cần có cơ chế, tạo môi trường kinh doanh cho doanh nghiệp tốt nhất, tạo cơ chế để làm ra tiền nhiều hơn. Ông Thăng so sánh các đô thị như Bắc Kinh, Thượng Hải, Thâm Quyến… của Trung Quốc từng được ban hành thể chế, chính sách và chỉ áp dụng cho riêng thành phố. Các biện pháp rà soát phòng chống gian lận thuế sẽ được đẩy mạnh; tiếp tục tháo gỡ khó khăn cho doanh nghiệp và đẩy mạnh phân cấp, phân quyền cho các huyện, quận, sở, ngành. Từ đó, công tác thu ngân sách sẽ tốt hơn...', b'0', 1465363448, 1465363448, 13, 13, b'0'),
	(73, 1, 150, 13, 0, 0, 'Khi được giải phóng toàn bộ năng lực con người, sản xuất thì TP HCM không thể tăng trưởng dừng ở một con số. Cơ chế đặc thù của thành phố là bình thường so với các đô thị khác trên thế giới, chỉ là khác biệt hơn so với các địa phương khác”, ông Thăng nói, đồng thời nhấn mạnh: “Thành phố phải mặc cái áo vừa cho sự phát triển hiện nay. Mặc cái áo bí bách quá không phát triển được', 'Khi được giải phóng toàn bộ năng lực con người, sản xuất thì TP HCM không thể tăng trưởng dừng ở một con số. Cơ chế đặc thù của thành phố là bình thường so với các đô thị khác trên thế giới, chỉ là khác biệt hơn so với các địa phương khác”, ông Thăng nói, đồng thời nhấn mạnh: “Thành phố phải mặc cái áo vừa cho sự phát triển hiện nay. Mặc cái áo bí bách quá không phát triển được', b'0', 1465363459, 1465363459, 13, 13, b'0'),
	(74, 1, 79, 13, 0, 0, 'Trước đó, trả lời phỏng vấn bên hành lang Quốc hội hồi cuối tháng 3, ông Đinh La Thăng cũng từng khẳng định điều mong muốn là xây dựng cho được một cơ chế đặc biệt để đưa TP HCM trở thành đô thị số một trong khu vực. Ông Thăng cũng nhiều lần nhắc lại thông điệp này trong quá trình điều hành thời gian qua.', 'Trước đó, trả lời phỏng vấn bên hành lang Quốc hội hồi cuối tháng 3, ông Đinh La Thăng cũng từng khẳng định điều mong muốn là xây dựng cho được một cơ chế đặc biệt để đưa TP HCM trở thành đô thị số một trong khu vực. Ông Thăng cũng nhiều lần nhắc lại thông điệp này trong quá trình điều hành thời gian qua.', b'0', 1465363537, 1465363537, 13, 13, b'0'),
	(75, 1, 79, 13, 0, 0, 'Trước những kiến nghị nêu trên, ông Đinh Văn Nhã - Phó chủ nhiệm Ủy ban Tài chính Ngân sách, cho rằng TP HCM cũng nên cân nhắc khi đưa ra một loạt đề nghị về ưu đãi, đặc thù. Bởi thực tế, thành phố vẫn đang được hưởng ưu đãi nhưng rải rác, phân tán, như tiền thoái vốn của doanh nghiệp Nhà nước được để lại đầu tư cho cơ sở hạ tầng. “Nên có lựa chọn, sắp xếp lại một số ưu đãi thống nhất để tránh chồng chéo và các địa phương khác so bì”, ông Nhã góp ý.', 'Trước những kiến nghị nêu trên, ông Đinh Văn Nhã - Phó chủ nhiệm Ủy ban Tài chính Ngân sách, cho rằng TP HCM cũng nên cân nhắc khi đưa ra một loạt đề nghị về ưu đãi, đặc thù. Bởi thực tế, thành phố vẫn đang được hưởng ưu đãi nhưng rải rác, phân tán, như tiền thoái vốn của doanh nghiệp Nhà nước được để lại đầu tư cho cơ sở hạ tầng. “Nên có lựa chọn, sắp xếp lại một số ưu đãi thống nhất để tránh chồng chéo và các địa phương khác so bì”, ông Nhã góp ý.', b'0', 1465363563, 1465363563, 13, 13, b'0'),
