oat: left; width: 30px; height: 30px; text-align: center; color: #ffffff; background: url(\'http://media.lamsao.com/Themes/Portal/Default/Images/bg-step.png\') 50% 50% no-repeat;">2</div>\n<div class="stepContent" style="box-sizing: border-box; margin: 0px 0px 0px 45px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;"><span style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: inherit;">Trả lời tin nhắn cực nhanh</span></p>\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">H&atilde;y d&ugrave;ng một ph&eacute;p thử đ&oacute; l&agrave; nhắn tin thường xuy&ecirc;n cho c&ocirc; ấy để biết n&agrave;ng c&oacute; th&iacute;ch m&igrave;nh hay kh&ocirc;ng. Nếu c&ocirc; ấy trả lời tin nhắn của bạn nhanh ch&oacute;ng v&agrave; biết c&aacute;ch x&acirc;y dựng c&acirc;u chuyện th&igrave; xin ch&uacute;c mừng c&ocirc; ấy đang muốn bật đ&egrave;n xanh với bạn đ&oacute;.&nbsp;</p>\n<ul style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style: inside;">\n<li style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Xem th&ecirc;m&nbsp;<a class="gs-title" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: #2ca9e1; text-decoration: none; background-color: transparent;" href="http://www.lamsao.com/cach-tan-gai-qua-dien-thoai-cho-cac-chang-p214a78085.html" target="_blank">C&aacute;ch t&aacute;n g&aacute;i qua điện thoại khiến n&agrave;ng đổ rầm rầm</a></li>\n</ul>\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Ngược lại, nếu chỉ l&agrave; những tin nhắn hờ hững v&agrave; cụt ngủn, th&igrave; tốt nhất bạn kh&ocirc;ng n&ecirc;n hỏi c&acirc;u hỏi: "l&agrave;m sao để biết con g&aacute;i th&iacute;ch m&igrave;nh\'\' nữa, v&igrave; c&acirc;u trả lời đ&atilde; qu&aacute; r&otilde; r&agrave;ng rồi.</p>\n</div>\n</li>\n</ul>\n<ul class="how" style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 16px; line-height: 25px; font-family: Roboto, Arial, serif; vertical-align: baseline; list-style: none; color: #555555;">\n<li class="jsArticleStep" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">\n<div class="stepNumber" style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: 30px; font-family: inherit; vertical-align: baseline; float: left; width: 30px; height: 30px; text-align: center; color: #ffffff; background: url(\'http://media.lamsao.com/Themes/Portal/Default/Images/bg-step.png\') 50% 50% no-repeat;">3</div>\n<div class="stepContent" style="box-sizing: border-box; margin: 0px 0px 0px 45px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;"><span style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: inherit;">T&igrave;m c&aacute;ch để được đi c&ugrave;ng nhau, gần gặn với bạn</span></p>\n<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;">Con g&aacute;i khi th&iacute;ch ai đ&oacute; thường kh&ocirc;ng n&oacute;i ra, họ thường t&igrave;m c&aacute;ch để được ở gần người con trai m&igrave;nh th&iacute;ch. C&oacute; thể l&agrave; lấy cớ đi c&ocirc;ng việc c&ugrave;ng, tham gia một chương tr&igrave;nh n&agrave;o đ&oacute; c&ugrave;ng nhau... Bạn h&atilde;y thử để &yacute;, nếu bạn v&agrave; người ấy thường xuy&ecirc;n ở gần nhau, th&igrave; đ&acirc;y ch&iacute;nh l&agrave; dấu hiệu n&agrave;ng